INDEX `id_municipio` USING BTREE (`id_municipio`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='InnoDB free: 12288 kB; (`id_municipio`) REFER `aguaparko/municipios`(`id_municip'
/*!50003 AUTO_INCREMENT=1139 */

;

